import React from 'react'
import { Container, Row, Col } from 'react-bootstrap'

function App() {
  return (
    <div className="m-test-wrap">
      <Container fluid>
        <Row>
          <Col>1 of 1</Col>
        </Row>
      </Container>
    </div>
  )
}
export default App;
